import {React} from 'react';
import {Link} from 'react-router-dom';
import "./TeamTile.scss";

export const TeamTile =({teamName}) => {
    var teamsList = {
        RR:"RR-Logo.png",
        CSK:"CSK-Logo.png",
        DC:"DC-Logo.jpg",
        GL:"GL-Logo.jpg",
        GT:"GT-Logo.png",
        KKR:"KKR-Logo.png",
        Kochi:"Kochi-Logo.png",
        LSG:"LSG-Logo.png",
        MI:"MI-Logo.png",
        PBKS:"PBKS-Logo.png",
        PWI:"PWI-Logo.jpg",
        RCB:"RCB-Logo.png",
        RPS:"RPS-Logo.jpg",
        SRH:"SRH-Logo.png"
    }

return(
    <div className="TeamTile">
        <h1>
            <Link to={`/team/${teamName}`}>
                <img src="" alt="team-logo"/>
            </Link>
        </h1>
    </div>
)
}
